import React from "react";
import "./App.css";
import {DishData} from './data'

export function Dishes() {
    const dishList = DishData.map( (data) =>
        <tr>
            <td>{data.title}</td>
            <td>{data.price}</td>
            <td>{data.category}</td>
        </tr>
    );
    return (<ol>{dishList}</ol>);
}


<table> 
<tr>
    <th>Name</th>
    <th>Category</th>
    <th>Price</th>
</tr>
</table>
